import { GET_APPOINTMENTS } from '../actions/types';
const initialState = {
  appointments: [],
  // subject: null,
  loading: true,
  // error: {},
};

export default function (state = initialState, action) {
  const { type, payload } = action;

  switch (type) {
    case GET_APPOINTMENTS:
      return {
        ...state,
        appointments: payload,
        loading: false,
      };
    default:
      return state;
  }
}
